import React, { Component } from 'react'
import "./styles.scss"
import { Container, View, Text} from '../../components/atoms'

class Dashboard extends Component{

    render(){

        return(
            <Container isEqualWidth="100%" isEqualHeight="100vh" justifyContent="center" alignItems="center" backgroundColor="#EDEDED">
                <View width="40%" height="40vh">
                    <Text>Content</Text>
                </View>
            </Container>
        )
    }
}


export default Dashboard
